import React from 'react'
import {Button, Box} from '@mui/material'
const Buttons = ({value}) => {

  return (

    <>
    <Box style={{display:'flex', flexDirection:'row', backgroundColor:'red'}}>
       <Button variant='contained' style={{backgroundColor:'green'}}>{value}</Button>
    </Box>
    </>
  )
}

export default Buttons
